import Container from 'react-bootstrap/Container';
import contactImg from '../images/contact-icon.png'
const Contact = () => {
    return (

       <>
       <Container>
           <div style={{textAlign:'center'}}>
           <img src={contactImg} width="100px" height='100px'/>
           </div>
        </Container>
       </>
    );
}

export default Contact;
